import React from 'react';
import Navbar from './components/Navbar';
import Map from './components/Map'; // Import Map component

const App = () => {
    return (
        <div>
            <Navbar />
            <h1 style={{ textAlign: 'center' }}>Bản đồ vị trí xe</h1>
            <Map />
        </div>
    );
};

export default App;
